import React, { useReducer } from 'react'
import { todoReducer } from './todoReducer'

import './style.css'

const initialState = [{
    id: new Data().getTime(),
    desc: 'Aprender React',
    done: false
}]

export const TodoApp = () => {

    const [todos] = useReducer(todoReducer, initialState)

    return (
        <div>
            <h1>Todo App</h1>
            <hr></hr>
        </div>
    )
}
